import axios from "axios";
import { configHeader } from "../components/functions/configHeader";

var env = require('../env');

var endpoint = env.endpoint;

var listWallets = function listWallets() {
  return axios.get("".concat(endpoint, "/wallets"), configHeader());
};

var getWalletsFromId = function getWalletsFromId(id) {
  return axios.get("".concat(endpoint, "/wallets/").concat(id), configHeader());
};

var getWallets = function getWallets(data) {
  return axios.post("".concat(endpoint, "/wallets/get"), data, configHeader());
};

var createWallets = function createWallets(data) {
  //console.log('data : ' + data.password);
  return axios.post("".concat(endpoint, "/wallets/register"), data, configHeader());
};

var editWallets = function editWallets(data, id) {
  //console.log('data : ' + data);
  return axios.put("".concat(endpoint, "/wallets/").concat(id), data, configHeader());
};

var deleteWallets = function deleteWallets(id) {
  return axios["delete"]("".concat(endpoint, "/wallets/").concat(id), configHeader());
};

export default {
  listWallets: listWallets,
  getWalletsFromId: getWalletsFromId,
  createWallets: createWallets,
  editWallets: editWallets,
  deleteWallets: deleteWallets,
  getWallets: getWallets
};
